CREATE TABLE IF NOT EXISTS rdbms_site (
    id serial primary  key     NOT NULL,
    name               text    NOT NULL UNIQUE
);

CREATE TABLE IF NOT EXISTS rdbms_action_type (
    id serial primary  key     NOT NULL,
    name               text    NOT NULL UNIQUE
);

CREATE TABLE IF NOT EXISTS rdbms_visitor (
    id bigserial primary key     NOT NULL,
    name                 text    NOT NULL UNIQUE
);

CREATE TABLE IF NOT EXISTS rdbms_action (
    id bigserial primary key     NOT NULL,
    timestamp            bigint  NOT NULL,
    site_id              int     REFERENCES rdbms_site(id),
    action_type_id       int     REFERENCES rdbms_action_type(id),
    visitor_id           bigint  REFERENCES rdbms_visitor(id),
    referrer             text    NULL,
    previous_page        text    NULL,
    geo                  text    NULL,
    time_spent_seconds   int     NOT NULL,
    sub_page             text    NULL
);

DROP SCHEMA public CASCADE;
CREATE SCHEMA public;

GRANT ALL ON SCHEMA public TO postgres;
GRANT ALL ON SCHEMA public TO public;
